import React from 'react';

const ChatBox = () => {

    const chat = ['hey', 'hello', "how are you?"]
    const chatDisplay = chat.map((msgs) => {
        React.createElement('p', null, msgs)
    })

    return(
        <div className="chat-box">
            <div className="msgs">
            {chatDisplay}
            </div>
            <form className="msg-form">
                <input id="text-field" type='text' placeholder='send message'/>
                <button id="send-btn" type='button'>send</button>
            </form>
        </div>
    )
}
export default ChatBox;
